import FlexRow from "layout/FlexRow";

export default function Prompt() {
    return (
        <div id="prompt">
            <FlexRow>
                <p>question</p>
                <p>info</p>
            </FlexRow>
                <form action="">
                    <FlexRow>
                        <textarea name="prompt-form" id="prompt-form">A corgie wearing a santa hat</textarea>
                        <input type="submit" />
                    </FlexRow>

                </form>
        </div>
    );
}
